import { NavigationContainer } from '@react-navigation/native';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import React, { useState, useContext, createContext } from "react";
import ValueProvider from "./components/to/ValueProvider";


import ProfileScreen from './components/Profile';
import AgeScreen from './components/Age';
import BmiScreen from './components/Bmi';

const Tab = createBottomTabNavigator();

export default function App() {
    const data = { height: 0, weight: 0, age: 0, name: '' }
    return (
        <ValueProvider value={data}>
            <NavigationContainer>
                <Tab.Navigator>
                    <Tab.Screen name="Profile" component={ProfileScreen} />
                    <Tab.Screen name="Age" component={AgeScreen} />
                    <Tab.Screen name='Bmi' component={BmiScreen} />
                </Tab.Navigator>
            </NavigationContainer>
        </ValueProvider>
    );
}
